EXEC INSERT_ALERTA(1986, 1987, '*Esta competiciï¿½n se separï¿½ en dos fases. En la primera fase (34 jornadas) se definieron tres grupos de 6 equipos (A, B y C). En la segunda fase (10 jornadas) los equipos de cada grupo jugaron una nueva liguilla donde los del grupo A se disputaron el tï¿½tulo, los del B el derecho a participar en un triangular con el campeï¿½n de Copa y el de Liga para disputarse la Copa de la Liga (que finalmente no se disputï¿½) y los del C se jugaban no caer en las 3 ï¿½ltimas posiciones de descenso, aunque durante el transcurso del mismo se acordï¿½ ampliar la Primera Divisiï¿½n a 20 equipos, por lo que sï¿½lo bajarï¿½a el colista. El Cï¿½diz denunciï¿½ el cambio de reglas durante la competiciï¿½n, el recurso fue aceptado y finalmente se anunciï¿½ un triangular entre ellos para que dos de ellos mantuvieran la categorï¿½a.');
COMMIT;

